import { Formik, Form, Field } from 'formik';

export const App = () => {
  return (
    <div>
      <h1>Phonebook</h1>
      <Formik
        initialValues={{ contacts: [], name: '', number: '' }}
        onSubmit={values => {
          alert(values);
        }}
      >
        <Form>
          <Field type="text" name="name" required />
          <Field type="tel" name="number" required />
          <button type="submit">Submit</button>
        </Form>
      </Formik>
    </div>
  );
};
